import React, { useState, useEffect } from 'react';
import { getDashboard } from '../api/api';

export default function DashboardPage() {
  const [stats, setStats] = useState(null);
  const fetchStats = async () => {
    const r = await getDashboard(1);
    setStats(r.data);
  };
  useEffect(() => { fetchStats(); }, []);
  if (!stats) return <div>Loading...</div>;
  return (
    <div>
      <h2>Dashboard</h2>
      <p>Total Resumes: {stats.total_resumes}</p>
      <p>Reviewed Resumes: {stats.reviewed_resumes}</p>
      <p>Total Questions: {stats.total_questions}</p>
      <p>Total Answers: {stats.total_answers}</p>
      <p>Evaluated Answers: {stats.total_evaluated_answers}</p>
    </div>
  );
}
